import s from './AddNewPostSection.module.css';
import addIcon from '../../../assets/img/icons/add-icon.svg';

const AddNewPostSection = () => {
	return (
		<div className={s.add_post}>
			<div className={s.row}>
				<img src="" alt="" />
			</div>
			AddNewPostSection
		</div>
	);
};

export default AddNewPostSection;
